import React, {Component} from 'react';
import ListOfPosts from './ListOfPosts'

class App extends Component {
  constructor(props){
    super(props)

    this.state = {
      searchInput : null,
      posts : [
        {
          articleID : 1,
          articleTitle : 'Title1',
          keywords : ['testkeyword1', 'testkeyword2'],
          datePublished : 'This is a date',
          sitePublishedOn : 'This is where the post came from',
          articleSummary : 'This is a summary of the article'
        },
        {
          articleID : 2,
          articleTitle : 'Title2',
          keywords : ['testkeyword3', 'testkeyword4'],
          datePublished : 'This is a date2',
          sitePublishedOn : 'This is where the post came from2',
          articleSummary : 'This is a summary of the article2'
        }
      ],
      isLoading : 'True'
    }

    this.componentDidMount = this.componentDidMount.bind(this)
  }

  componentDidMount(){
    this.setState({
      isLoading : 'False'
    })
    this.getData();
  }

  getData(dataToRequest){
    //This will call to the express server to request the data it has stored
  }

  render(){
    return(
      <div id='feedContainer'>
        <ListOfPosts posts={this.state.posts}/> 
      </div>
    )
  }
}

export default App;
